/*Table structure for table `adj_eod_stock` */

DROP TABLE IF EXISTS `adj_eod_stock`;

CREATE TABLE `adj_eod_stock` (
  `company_id` int(30) NOT NULL,
  `entry_date` date NOT NULL,
  `entry_timestamp` int(10) unsigned NOT NULL,
  `open` decimal(16,2) NOT NULL,
  `high` decimal(16,2) NOT NULL,
  `low` decimal(16,2) NOT NULL,
  `ltp` decimal(16,2) NOT NULL,
  `ycp` decimal(16,2) NOT NULL,
  `cse_price` decimal(9,2) NOT NULL,
  `cse_volume` decimal(18,2) NOT NULL,
  `total_trade` int(30) NOT NULL,
  `total_volume` int(30) NOT NULL,
  `total_value` decimal(18,4) NOT NULL,
  UNIQUE KEY `company_id_entry_date` (`company_id`,`entry_date`),
  KEY `entry_date` (`entry_date`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `adj_eod_stock` */

/*Table structure for table `audit_info` */

DROP TABLE IF EXISTS `audit_info`;

CREATE TABLE `audit_info` (
  `audit_ID` int(11) NOT NULL,
  `company_id` int(6) NOT NULL COMMENT 'Company ID from company table',
  `firm_name` varchar(150) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Audit Firm Name',
  `year` year(4) NOT NULL COMMENT 'Auditing Year',
  KEY `company_id` (`company_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `audit_info` */

/*Table structure for table `capital` */

DROP TABLE IF EXISTS `capital`;

CREATE TABLE `capital` (
  `capital_ID` int(11) NOT NULL AUTO_INCREMENT,
  `company_id` int(6) NOT NULL,
  `authorized_capital` decimal(18,2) NOT NULL,
  `auth_cap_change_date` date NOT NULL COMMENT 'Authorized Capital changing date',
  `paidup_capital` decimal(18,2) NOT NULL,
  `paidup_cap_change_date` date NOT NULL COMMENT 'Paidup Capital Change Date',
  `insert_ts` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`capital_ID`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

/*Data for the table `capital` */

/*Table structure for table `company` */

DROP TABLE IF EXISTS `company`;

CREATE TABLE `company` (
  `ID` int(11) NOT NULL AUTO_INCREMENT COMMENT 'stock ID',
  `code` varchar(30) COLLATE utf8_unicode_ci NOT NULL COMMENT 'ticker',
  `name` varchar(60) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Full Name',
  `sector_id` int(11) NOT NULL COMMENT 'Sector ID ( ID from Sector Table)',
  `dsex` int(11) NOT NULL COMMENT 'If Company in DSEX listed',
  `dse30` int(11) NOT NULL COMMENT 'If Company in DSE 30 listed',
  `dses` int(11) NOT NULL COMMENT 'DSE Sharih',
  `face_value` decimal(6,2) NOT NULL COMMENT 'Face Value of Share',
  `offer_price` int(15) NOT NULL COMMENT 'Share Offer Price',
  `category` text COLLATE utf8_unicode_ci NOT NULL COMMENT 'Listed category',
  `electronic` int(2) NOT NULL COMMENT 'Electronic Share',
  `listing_year` year(4) NOT NULL COMMENT 'DSE listing Year',
  `establishing_date` date NOT NULL,
  `tradingstart_date` date NOT NULL,
  `year_end` date NOT NULL COMMENT 'Financial closing year',
  `market_lot` int(11) NOT NULL,
  `cfi_code` varchar(30) COLLATE utf8_unicode_ci NOT NULL COMMENT 'CFI code',
  `gics` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `parent-company` varchar(60) COLLATE utf8_unicode_ci NOT NULL,
  `address` varchar(200) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Registered Company Address',
  `telephone` varchar(20) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Telephone',
  `fax` varchar(20) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Fax',
  `email` varchar(55) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Email address',
  `website` varchar(60) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Website Adress',
  `purpose` mediumtext COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`ID`),
  UNIQUE KEY `code` (`code`),
  KEY `sector_id` (`sector_id`),
  KEY `dsex` (`dsex`,`dse30`)
) ENGINE=MyISAM AUTO_INCREMENT=530 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

