/*Table structure for table `dividend_info` */

DROP TABLE IF EXISTS `dividend_info`;

CREATE TABLE `dividend_info` (
  `divident_ID` int(11) NOT NULL AUTO_INCREMENT,
  `company_id` int(11) NOT NULL COMMENT 'Company ID',
  `year` year(4) NOT NULL COMMENT 'Financial Year',
  `right_base` int(11) NOT NULL COMMENT 'Right Share base i.e 5:1',
  `right_new` int(11) NOT NULL COMMENT 'Right Offered ',
  `right_dec_date` date NOT NULL COMMENT 'Right Share declaration Date',
  `right_rec_date` date NOT NULL COMMENT 'Right Share Record Date',
  `interim_cash` decimal(6,2) NOT NULL COMMENT 'Interim Divident Cash',
  `interim_stock` decimal(8,2) NOT NULL COMMENT 'Interim Divident Stock',
  `interim_dec_date` date NOT NULL COMMENT 'Interim Divident Declaration Date',
  `interim_rec_date` date NOT NULL COMMENT 'Interim Divident Record Date',
  `annual_cash` decimal(6,2) NOT NULL COMMENT 'Year end Divident cash',
  `annual_stock` decimal(8,2) NOT NULL COMMENT 'Year End Divident Stovk',
  `annual_dec_date` date NOT NULL COMMENT 'Year end divident Declaration date',
  `annual_rec_date` date NOT NULL COMMENT 'Year end divident Record Date',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Info update date time',
  PRIMARY KEY (`divident_ID`),
  KEY `company_id` (`company_id`),
  KEY `interim_rec_date` (`interim_rec_date`),
  KEY `annual_rec_date` (`annual_rec_date`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

