  `company_id` int(11) NOT NULL,
  `entry_date` date NOT NULL,
  `entry_timestamp` int(10) unsigned NOT NULL,
  `open` decimal(16,2) NOT NULL,
  `high` decimal(16,2) NOT NULL,
  `low` decimal(16,2) NOT NULL,
  `ltp` decimal(16,2) NOT NULL,
  `ycp` decimal(16,2) NOT NULL,
  `cse_price` decimal(9,2) NOT NULL,
  `cse_volume` decimal(18,2) NOT NULL,
  `total_trade` int(30) NOT NULL,
  `total_volume` int(30) NOT NULL,
  `total_value` decimal(18,4) NOT NULL,
  UNIQUE KEY `company_id_entry_date` (`company_id`,`entry_date`),
  KEY `entry_date` (`entry_date`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

