/* Trigger structure for table `mkistat` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `_replicate_mki_to_eod` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'localhost' */ /*!50003 TRIGGER `_replicate_mki_to_eod` BEFORE INSERT ON `mkistat` FOR EACH ROW BEGIN
 REPLACE INTO eod_stock
 SELECT
  (SELECT ID FROM company WHERE code = NEW.MKISTAT_INSTRUMENT_CODE) AS company_id,
  CONCAT(
   SUBSTR(SUBSTRING_INDEX(NEW.MKISTAT_LM_DATE_TIME, '/', -1),1,4),
   '-', LPAD(SUBSTRING_INDEX(NEW.MKISTAT_LM_DATE_TIME, '/', 1), 2, '0'),
   '-', LPAD(SUBSTR(SUBSTRING_INDEX(NEW.MKISTAT_LM_DATE_TIME, '/', 2), LOCATE('/',SUBSTRING_INDEX(NEW.MKISTAT_LM_DATE_TIME, '/', 2))+1), 2, '0')
  ) AS entry_date,
  UNIX_TIMESTAMP(CONCAT(
   SUBSTR(SUBSTRING_INDEX(NEW.MKISTAT_LM_DATE_TIME, '/', -1),1,4),
   '-', LPAD(SUBSTRING_INDEX(NEW.MKISTAT_LM_DATE_TIME, '/', 1), 2, '0'),
   '-', LPAD(SUBSTR(SUBSTRING_INDEX(NEW.MKISTAT_LM_DATE_TIME, '/', 2), LOCATE('/',SUBSTRING_INDEX(NEW.MKISTAT_LM_DATE_TIME, '/', 2))+1), 2, '0'),
   ' ', SUBSTRING_INDEX(NEW.MKISTAT_LM_DATE_TIME, ' ', -1)
  )) AS entry_timestamp,
  NEW.MKISTAT_OPEN_PRICE AS `open`,
  NEW.MKISTAT_HIGH_PRICE AS `high`,
  NEW.MKISTAT_LOW_PRICE AS `low`,
  IF(
   NEW.MKISTAT_CLOSE_PRICE,
   NEW.MKISTAT_CLOSE_PRICE,
   IF(
    NEW.MKISTAT_PUB_LAST_TRADED_PRICE,
    NEW.MKISTAT_PUB_LAST_TRADED_PRICE,
    IF(NEW.MKISTAT_SPOT_LAST_TRADED_PRICE, NEW.MKISTAT_SPOT_LAST_TRADED_PRICE, 0)
   )
  ) AS ltp,
  NEW.MKISTAT_YDAY_CLOSE_PRICE AS `ycp`, 
  0 AS cse_price,
  0 AS cse_volume,
  NEW.MKISTAT_TOTAL_TRADES AS total_trades,
  NEW.MKISTAT_TOTAL_VOLUME AS total_volume,
  NEW.MKISTAT_TOTAL_VALUE AS total_value
  
  
 FROM DUAL;
END */$$


DELIMITER ;

